import React from 'react'
import './Navbar.css'
import '../../cssHelper/helper.css'

function Navbar() {
  return (
    <div className='Navbar w-full white-clr'>
      <div className="nav-bar-container p-inline-3 flex j-between a-center">
        <p className='font-sm'>E- commerce application</p>
      </div>
    </div>
  )
}

export default Navbar
